/****** Object:  UserDefinedFunction [dbo].[SoSVDaDangKy]    Script Date: 06/07/2016 1:21:13 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create function [dbo].[SoSVDaDangKy](@LopHocPhan int)
returns int
as begin
 --declare @LopHocPhan int
 declare @SoLuongDK as int
 select @SoLuongDK = count(id_lophocphan)
 from tbl_hp_dangky hpdk
 where (hpdk.is_delete != 1 or hpdk.is_delete is null)
 and hpdk.id_lophocphan = @LopHocPhan
return @SoLuongDK
end;


